    protected container getPaymSpecFieldsMetaData(str _formatID)
    {
        container   paymSpecFieldsList;

        //Metadata column names of data elements
//FormatGroup,FormatID,PaymentSpec,FormatFieldID,Description,FieldType,CodeID,DefaultValue,Required,FixedValue,FixedValueMask,TechNotes

        switch (_formatID)
        {
            case ('US-BOA-XML'):
                paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_BOA_XML();
                break;

            case ('US-BOA-XML-PL'):
                paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_BOA_XML_PL();
                break;

            case ('US-BOA-XML-UK'):
                paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_BOA_XML_UK();
                break;

            case ('US-BOA-XML-CA'):
                paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_BOA_XML_CA();
                break;

            case('US-BOA-XML-ID'):
                paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_BOA_XML_ID();
                break;

            case ('US-BOA-XML-SE'):
