/// <summary>
/// Updating the bank code lookpups from the W0X fields.
/// </summary>
protected void updateBankCodelookupValues()
{
    switch(gSKS_EFT_FileFormat.FormatId)
    {
        case('US-BOA-XML'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('InitgPtyId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('WireRoutingNum', gSKS_EFT_Bank.W02);
            }
            if(gSKS_EFT_Bank.W03)
            {
                this.updateBankFields('CheckRoutingNum', gSKS_EFT_Bank.W03);
                this.updateBankFields('VirtualPayablesWorkID', gSKS_EFT_Bank.W03);
            }
            if(gSKS_EFT_Bank.W04)
            {
                this.updateBankFields('ItemizeACH', gSKS_EFT_Bank.W04, true);
            }
            break;
        case('US-BOA-XML-CA'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('InitgPtyId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('DbtrAgtBranchId', gSKS_EFT_Bank.W02);
            }
            if(gSKS_EFT_Bank.W03)
            {
                this.updateBankFields('CheckRoutingNum', gSKS_EFT_Bank.W03);
            }
            break;
        case('US-BOA-XML-HK'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('InitgPtyId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('BtchBookg', gSKS_EFT_Bank.W02, true);
            }
            break;
        case('US-BOA-XML-AU'):
        case('US-BOA-XML-BR'):
        case('US-BOA-XML-BY'):
        case('US-BOA-XML-CN'):
        case('US-BOA-XML-DE'):
        case('US-BOA-XML-ES'):
        case('US-BOA-XML-FR'):
        case('US-BOA-XML-GR'):
        case('US-BOA-XML-HU'):
        case('US-BOA-XML-IE'):
        case('US-BOA-XML-IL'):
        case('US-BOA-XML-IN'):
        case('US-BOA-XML-IT'):
        case('US-BOA-XML-JM'):
        case('US-BOA-XML-KR'):
        case('US-BOA-XML-KZ'):
        case('US-BOA-XML-LU'):
        case('US-BOA-XML-MX'):
        case('US-BOA-XML-MY'):
        case('US-BOA-XML-NL'):
        case('US-BOA-XML-NZ'):
        case('US-BOA-XML-RU'):
        case('US-BOA-XML-SE'):
        case('US-BOA-XML-SG'):
        case('US-BOA-XML-TW'):
        case('US-BOA-XML-UK'):
        case('US-BOA-XML-DO'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('InitgPtyId', gSKS_EFT_Bank.W01);
            }
            break;
    }
}

/// <summary>
/// Updating vednor code lookpus from BE0X and Legacu code loookups
/// </summary>
protected void updateVendorCodelookupValues()
{
    switch(gSKS_EFT_FileFormat.FormatId)
    {
        case('US-BOA-XML'):
        case('US-BOA-XML-DE'):
        case('US-BOA-XML-ES'):
        case('US-BOA-XML-FR'):
        case('US-BOA-XML-GR'):
        case('US-BOA-XML-HK'):
        case('US-BOA-XML-HU'):
        case('US-BOA-XML-IN'):
        case('US-BOA-XML-IT'):
        case('US-BOA-XML-MY'):
        case('US-BOA-XML-NL'):
        case('US-BOA-XML-SE'):
        case('US-BOA-XML-SG'):
        case('US-BOA-XML-UK'):
            if(gSKS_EFT_VendorPaym.WChargesIndic)
            {
                this.updateVendorFields('ChrgBr', gSKS_EFT_VendorPaym.WChargesIndic, true);
            }
            break;
        case('US-BOA-XML-CN'):
            if(gSKS_EFT_VendorPaym.BE01)
            {
                this.updateVendorFields('DivertIndicator', gSKS_EFT_VendorPaym.BE01);
            }
            break;
    }
}
